import React, { useState } from 'react';
import { Form, Input, Button, TreeSelect } from 'antd';

const { TreeNode } = TreeSelect;

const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 },
};

const Join = () => {
  const [selectValue, setSelectValue] = useState('');
  const onFinish = (values) => {
    console.log('Success:', values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };

  const onChange = (value) => {
    console.log(value);
    setSelectValue(value);
  };

  return (
    <div style={{ backgroundColor: '#272727', height: '800px' }}>
      <div style={{ backgroundColor: 'white', width: '400px', height: '500px', position: 'absolute', top: '20%', left: '38%', padding: '10px' }}>
        <Form {...layout} name="join" initialValues={{ remember: true }} onFinish={onFinish} onFinishFailed={onFinishFailed}>
          <Form.Item label="Username" name="username" rules={[{ required: true, message: 'Please input your username!' }]}>
            <Input />
          </Form.Item>
          <Form.Item label="Password" name="password" rules={[{ required: true, message: 'Please input your password!' }]}>
            <Input.Password />
          </Form.Item>
          <Form.Item label="Select">
            <TreeSelect
              showSearch
              style={{ width: '100%' }}
              value={selectValue}
              dropdownStyle={{ maxHeight: 400, overflow: 'auto' }}
              placeholder="Please select"
              allowClear
              treeDefaultExpandAll
              onChange={onChange}
            >
              <TreeNode value="parent 1" title="소프트웨어대학">
                <TreeNode value="parent 1-0" title="컴퓨터공학" />
                <TreeNode value="parent 1-0" title="ICT 융합학부" />
              </TreeNode>
              <TreeNode value="parent 1-1" title="parent 1-1">
                <TreeNode value="sss" title={<b style={{ color: '#08c' }}>sss</b>} />
              </TreeNode>

            </TreeSelect>
          </Form.Item>
          <Form.Item {...tailLayout}>
            <Button type="primary" htmlType="submit">
              가입하기
            </Button>
          </Form.Item>
        </Form>
      </div>
    </div>
  );
};

export default Join;

